import React from 'react';
import ticketList from './ticketList.json';

function Tickets () {
    const tick = ticketList.tickets;
    const listTick = tick.map((item) => {
        <li key={item.price}>
                    {item.origin}
                    {item.origin_name}
                    {item.destination}
                    {item.destination_name}
                    {item.departure_date}
                    {item.departure_time}
                    {item.arrival_date}
                    {item.arrival_time}
                    {item.carrier}
                    {item.stops}
                    {item.price}
                </li>
    })

    return(
        <ul>
            {listTick}
        </ul>
    )
}

export default Tickets;
